import styled from 'styled-components';

const Container = styled.div`
	height: 10rem;

	img {
		height: 30%;
	}
`;

const LogoStyle = styled.div`
	display: flex;
	img {
		height: 10%;
	}
`;

export { Container, LogoStyle };
